import { BrowserRouter, Route, Router } from "react-router-dom";
import Home from "../pages/Home";
import Footer from "./Footer";
import Header from "./Header";

export default function Body(){
    return(
      <>
      <Header/>
      <BrowserRouter>
      <Router>
      <Routes>
        <Route path="/" exact={true} element={<Home />} />
      </Routes>
    </Router>
      </BrowserRouter>
      <Footer/>
      </>
    )
    
}
